                        R$50,90</p>
                </div>
                <div>
                    <img src={ casualWear } alt="" />
                    <p>Double coat<br />
                        R$59,90</p>
                </div>    
        </Section>
    )
}

const Section = styled.section`
    display: flex;
    max-width: 1300px;
    margin: 0px auto;
    flex-wrap: wrap;
    text-align: center;
    background-color: rgb(252, 245, 237);

    div{
        padding:10px 5px;
    }
    /* Destaque primeira linha */
    div:nth-child(-n+3){
        flex: 1 0 333px;
    }
    div:nth-child(1) img{
        border-bottom: 25px solid #333;
    }
    div:nth-child(2) img{

        border-bottom: 25px solid #071726;
    }
    div:nth-child(3) img{
        border-bottom: 25px solid #9CA4A6;
    }

    /*  */

    div:nth-child(n+4) {
        flex: 1 0 270px;
    }
`;
